import ExpensesItem from './ExpensesItem';
const ExpensesList = (props) => {
    const filterdYearNoDataMesg = props.filteredYear.length > 0 ? props.filteredYear.map((expense) => (
        <ExpensesItem
          key = {expense.id}
          title={expense.title}
          cost={expense.cost}
          date={expense.date}
        />
      )) : <p>No date found</p>
return filterdYearNoDataMesg;
}
export default ExpensesList;
